import logo from "../assets/logo.png";

const svgClass = "h-16 w-16 block";
const pathClass = "fill-green-3";

export function Logo() {
  return (
    <div className="flex items-center">
      <img src={logo} alt="PC logo" className="h-20 w-20" />
      <div>
        <h1 className="text-xl font-bold text-green-3">PC</h1>
        <p className="text-xs font-semibold text-green-3">Build your own</p>
      </div>
    </div>
  );
}

type CartProps = { items: number };

export function Cart({ items }: CartProps) {
  return (
    <button className="relative rounded-full p-2 hover:bg-white-2">
      <svg
        viewBox="0 0 24 24"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        width="24"
        height="24"
      >
        <path
          d="m3.5 3 1.033 3.194m0 0 1.582 6.59a3 3 0 0 0 2.917 2.3h6.403a3 3 0 0 0 2.91-2.273l1.344-5.374a1 1 0 0 0-.97-1.243H4.533Z"
          stroke="#375437"
          strokeWidth="1.8"
          strokeLinecap="round"
        ></path>
        <path
          d="M8.39 17.252a1.333 1.333 0 1 1 1.886 1.885 1.333 1.333 0 0 1-1.885-1.885ZM14.613 17.252a1.333 1.333 0 1 1 1.885 1.885 1.333 1.333 0 0 1-1.885-1.885Z"
          fill="#375437"
        ></path>
      </svg>
      <div className="absolute bottom-0 right-0 h-5 w-5 rounded-full bg-[#171615] text-sm text-[#ffffff]">
        {items}
      </div>
    </button>
  );
}

